const axios = require('axios');

const getNotesFromServer = () => {
    return new Promise(function (resolve, reject) {
            var notesList;
            axios.get('http://gateway-sandbox.apps.ca-central-1.starter.openshift-online.com/gateway/getNotes')
            .then(response => {
                console.log(response.data.notes[0]);
                var note;
                for (note of response.data.notes) {
                    notesList += <div><p>note</p><br/></div>;
                }
                resolve(notesList);
            })
            .catch(error => {
                console.log(error);
                reject(error);
            })
        }
    )
}

